import React, { useEffect, useState } from "react";
import { getAllLaunchList } from "./Utility/Services/launch";
const SpaceLaunchList = () => {
  const [state, setState] = useState({ launchList: [] });
  useEffect(() => {
    getAllLaunchList().then((res) => {
      if (res.error) {
        return;
      }
      if(!res.error)
      {
          state.launchList=res.data
      }
    });
  }, []);
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-lg-4">Filter</div>
          <div className="col-lg-8">List</div>
        </div>
      </div>
    </>
  );
};
export default SpaceLaunchList;
